DROP TABLE KXD_KJW.T_XT_WORK_DAY;
CREATE TABLE KXD_KJW.T_XT_WORK_DAY (
N_YEAR NUMBER(4) NOT NULL ,
N_MONTH NUMBER(2) NOT NULL ,
N_DAY NUMBER(2) NOT NULL ,
TODAY VARCHAR2(8 BYTE) NOT NULL ,
WD_FLAG CHAR(1 BYTE) NOT NULL ,
ONE_DAYS_BEFORE VARCHAR2(8 BYTE) NULL ,
ONE_DAYS_AFTER VARCHAR2(8 BYTE) NULL ,
LRRY_ID VARCHAR2(32 BYTE) DEFAULT '1'  NOT NULL ,
LR_SJ TIMESTAMP(6)  DEFAULT SYSDATE  NOT NULL ,
XGRY_ID VARCHAR2(32 BYTE) NULL ,
XG_SJ TIMESTAMP(6)  NULL ,
END_BATCHTIME TIMESTAMP(6)  NULL ,
INVEST_STATE CHAR(1 BYTE) NULL ,
CUT_DAYTIME TIMESTAMP(6)  NULL 
)
;
COMMENT ON TABLE KXD_KJW.T_XT_WORK_DAY IS '工作日表，系统初始化最近几年日历数据。通过WD_FLAG标识标示出当天天是否工作日';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."N_YEAR" IS '年';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."N_MONTH" IS '月';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."N_DAY" IS '日';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."TODAY" IS '日期';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."WD_FLAG" IS '1 工作日
0 非工作日';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."ONE_DAYS_BEFORE" IS '前一个工作日';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."ONE_DAYS_AFTER" IS '后一个工作日';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."LRRY_ID" IS '录入人员';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."LR_SJ" IS '录入时间';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."XGRY_ID" IS '修改人员';
COMMENT ON COLUMN KXD_KJW.T_XT_WORK_DAY."XG_SJ" IS '修改时间';

